iators; Madison Radicals; Minnesota Wind Chill; Montreal Royal; Nashville NightWatch; New York Empire; Ottawa Outlaws; Philadelphia Phoenix; Pittsburgh Thunderbirds; Raleigh Flyers; San Diego Growlers; San Francisco FlameThrowers; San Jose Spiders; Seattle Cascades; Tampa Bay Cannons; Toronto Rush.\n\nReal-time Stats, News, Scores, Highlights and more are available to fans on web and mobile with the AUDL App.\n\nFor more information, as well as all the latest AUDL news and highlights, check in with the league's official website at http://theaudl.com/\n\nSubscribe on YouTube: http://www.youtube.com/theAUDLchannel\nDownload the AUDL App: http://theaudl.com/app\nLike us on Facebook: https://www.facebook.com/theAUDL\nFollow us on Twitter: https://twitter.com/theAUDL\nFollow us on Instagram: https://instagram.com/theaudl/\nShop for AUDL Gear: http://shop.theaudl.com/","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/JQBawZfIT-A/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLDokSeq9ydYbABFl5IogzCeE77Gxg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/JQBawZfIT-A/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLDBLSInSIRWG10cHuMlo9sMAh2eTw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/JQBawZfIT-A/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLBrnkZcCBM5_bFPa1BjMQlkqNsPSw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/JQBawZfIT-A/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLAIf5Q0USgkgJOZDE9l5Gab0Q24tw","width":336,"height":188},{"url":"https://i.ytimg.com/vi_webp/JQBawZfIT-A/maxresdefault.webp","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"83205","author":"AUDL","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"128000","endTimeMs":"143000","watermark":{"thumbnails":[{"u
